    print("\n\nTransmitting the NN. With the following specification:")
    length  = ctypes.c_uint16(len(model_data))
    len_lsb = to_bytes(length)[0]
    len_msb = to_bytes(length)[1]
    crc     = block_crc(model_data)
    crc_lsb = to_bytes(crc)[0]
    crc_msb = to_bytes(crc)[1]
    # print(length)
    # print(crc)
    print("len_lsb: ",len_lsb,"\nlen_msb: ",len_msb,"\ncrc_lsb: ",crc_lsb,"\ncrc_msb: ",crc_msb)
    # Drone expects msb first the lsb 
    ser.write(len_lsb) #lsb
    ser.write(len_msb) #msb
    ser.write(crc_lsb)
    ser.write(crc_msb)

    #ser.flush()
    #time.sleep(0.1)

    for s in tqdm(to_bytes(model_data)):
        ser.write(s)
        #ser.write(b"s")
        #print(s)
        #ser.flush()
        time.sleep(0.001) #This delay is necessary ow we lose data.
        #time.sleep(0.01) #This delay is necessary ow we lose data.

    print("**************** Transmission done. ****************")

